import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    user: [
      {
        user1: [
          {
            text: "foo",
          },
          {
            text: "bar",
          },
          {
            id: 0,
          },
        ],
      },
      {
        user2: [
          {
            text: "foo",
          },
          {
            text: "bar",
          },
          {
            id: 1,
          },
        ],
      },
      {
        user3: [
          {
            text: "foo",
          },
          {
            text: "bar",
          },
          {
            id: 2,
          },
        ],
      },
      {
        user4: [
          {
            text: "foo",
          },
          {
            text: "bar",
          },
          {
            id: 3,
          },
        ],
      },
    ],
    input: "",
  };

  moveToNext = () => {};

  render() {
    return (
      <div className="App">
        <div className="container">
          <div>
            <div className="user1">
              <h2 className="name">Winnie</h2>
            </div>
            <List blocktext={this.state.user[0].user1} />
          </div>
          <div>
            <div className="user2">
              <h2 className="name">Bob</h2>
            </div>
            <List blocktext={this.state.user[1].user1} />
          </div>
          <div>
            <div className="user3">
              <h2 className="name">Thomas</h2>
            </div>
            <List blocktext={this.state.user[2].user1} />
          </div>
          <div>
            <div className="user4">
              <h2 className="name">George</h2>
            </div>
            <List blocktext={this.state.user[3].user1} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
